    	"I don't know most of these people, but instantly I feel supported by them. We are part of this, and we are together. That sounds cliché, but the experience is palpable. When the bus passed by Iguala, a town near Ayotzinaba, I inevitably felt discomfort and fear. In this town, 43 students from the rural teacher-training college Burgos were disappeared on September 26, 2014. The reason we came here is to attend the International Tribunal of Conscience of Peoples in Movement (ITCPM) in response to an invitation from the NationalLawyers Guild's Task Force on the Americas and the Mexican People's Lawyers Society (Asociación Mexican de Abogados del Pueblo). The ITCPM was created to provide an opportunity for relatives and victims of political violence, disappearance, and land displacement in Guerrero, Puebla, and Mexico City to present their cases in tribunal hearings and seek potential legal support and follow-up from a group of Mexican and international judges. Dulce, Marcela, and I are somatic practitioners and are joined by three psychologists to provide emotional support to the participants of the tribunahandings in Guerrero from August 12 to August 15, 2018.":  
