         "Dulce, Marcela, and I all share similar backgrounds and have become interested in somatic approaches to movement. We trained and received certifications in Body-Mind-Centering (Dulce and Diana) and Feldenkrais (Marcela). While we lived outside Mexico, we gained further knowledge, professional credentials, and experience in somatic practices, dance, and choreography. Although we regularly engage in somatic practices outside of Mexico, our regular practice is conducted in Mexico.":
