    	"watch Ishmael dance with his mother on TV,PBS, Alive from Off Center, and for a moment I want to be Ishmael, I want to dance with my mom. Dance your little heart out Chucky, his mom says!Fuck him, I say to myself, with abandoned envy. 1995. Performance Space 122. Tonight I watched Ishmael catch flying spit, Keith Hennessy's spit, gobs of it, right in the center of his mouth, again and again. Like he was inlove, making love. I haven't seen anything as artfully violent on stage since then. Just saw the reconstruction of THEM at PS122. I miss the original version in 1985, probably because I was at a Bill T. Jones/Arnie Zane show, or maybe Molissa Fenley, or maybe a Charlie Moulton extravaganza, the superstars at the time. Damn, it was disturbing, vital, pertinent, raw, and still timely. In 1985 I was going to basketball class every day. Enough said. 2011. At Judson Memorial Church, Yvonne Meier (Ishmael's ex of many years back) asked Ishmael to strip naked and roll around in a pile of dirt and he did. And then he put on a skirt made of bags of walnuts and she told him to jump up and down. And he did, for a long time. Which Freaked the dancer-choreographer David Thomson out, me too. I think David was even crying.\n\n":{}

