"The Joy of Walking is a series of dance workshops designed to explore the connection between movement and human connection. We've been working on these sessions for several years, but lately we decided to bring them to a new generation with an emphasis on inclusivity and emotional depth. One of our key themes has been understanding that walking as a form of connection can be both physical and deeply personal. We've been using a variety of materials in these workshops, including videos, audio recordings, and interactive exercises, to help participants reflect on their experiences of walking and how it affects them. We believe that by paying attention to the physical sensations and emotions involved, we can foster more meaningful connections between people. Through these sessions, we want to show that walking isn't just a form of exercise but also a way to build trust, understand each other better, and create a sense of community. We're excited about how this will impact people's lives and bring them closer together as a collective group.":


"Walking is not only physical movement but also a meditative experience. It allows us to release tension in our bodies and to express ourselves more deeply. When we walk silently, it creates an environment that encourages introspection. In CI spaces, walking can become a way to navigate social hierarchies, express discomfort, or seek connection with someone who is at different levels of power. However, walking alone doesn't always lead to meaningful connections; it depends on how participants choose to engage with the movement and the context in which they are walking. By paying attention to both the physical sensations and the emotions experienced during walking, we can enhance our ability to connect with others. CI stands for "
